INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(2, 'Meditec Clinic', '53 Ba Trieu, Hoan Kiem, Hanoi', '<p><strong>GENERAL INTRODUCTION</strong></p>\n<p>Meditec General Clinic has a team of experts with many years of experience from leading hospitals such as Viet Duc Hospital, Medical University Hospital, Bach Mai Hospital... with spacious and polite facilities, modern synchronous equipment system with technology from Germany, Japan, USA...</p>\n<p>With most diseases, patients can be examined at the Clinic. Some specialties are developed by the clinic, becoming specialized strengths such as: Neurology, Mental Health, Gastroenterology, Orthopedic Trauma, and Orthopedics.</p>\n<p><strong>A team of good doctors with many years of experience in examination and treatment in the fields of Neurology, Mental Health, Gastroenterology, Orthopedic Trauma, and Orthopedics.</strong></p>\n<ul>\n<li>Ths. Bs. Bui Quang Huynh: Deputy Head of Diagnostic Imaging Department of Viet Duc Hospital</li>\n<li>Gastroenterologist Nguyen Thi Tuyet Van: more than 30 years of experience in examining and treating diseases of the stomach and colon</li>\n<li>Assoc.Prof.Dr.BS Ngo Van Toan: Specialist Doctor of Surgery</li>\n<li>Assoc. Prof. TS.BS Nguyen Trong Hung: Internal Medicine Specialist</li>\n</ul>\n<p><strong>A system of modern and synchronous equipment for effective diagnosis and treatment:</strong></p>\n<ul>\n<li>Magnetom Amira 1.5 Tesla from Siemens (Germany)</li>\n<li>4D ultrasound machine - Voluson P8 Healthcare of America</li>\n<li>Digital X-ray machine</li>\n</ul>\n', '**GENERAL INTRODUCTION**\n\n\nMeditec General Clinic has a team of experts with many years of experience from leading hospitals such as Viet Duc Hospital, Medical University Hospital, Bach Mai Hospital... with spacious and polite facilities, modern synchronous equipment system with technology from Germany, Japan, USA...\n\nWith most diseases, patients can be examined at the Clinic. Some specialties are developed by the clinic, becoming specialized strengths such as: Neurology, Mental Health, Gastroenterology, Orthopedic Trauma, and Orthopedics.\n\n**A team of good doctors with many years of experience in examination and treatment in the fields of Neurology, Mental Health, Gastroenterology, Orthopedic Trauma, and Orthopedics.**\n\n* Ths. Bs. Bui Quang Huynh: Deputy Head of Diagnostic Imaging Department of Viet Duc Hospital\n* Gastroenterologist Nguyen Thi Tuyet Van: more than 30 years of experience in examining and treating diseases of the stomach and colon\n* Assoc.Prof.Dr.BS Ngo Van Toan: Specialist Doctor of Surgery\n* Assoc. Prof. TS.BS Nguyen Trong Hung: Internal Medicine Specialist\n\n**A system of modern and synchronous equipment for effective diagnosis and treatment:**\n\n* Magnetom Amira 1.5 Tesla from Siemens (Germany)\n* 4D ultrasound machine - Voluson P8 Healthcare of America\n* Digital X-ray machine', 'data:image/jpeg;base64,', '2023-03-09 13:44:33', '2023-03-10 14:11:29');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(3, 'Hung Viet Cancer Hospital', '43 Dai Co Viet, Hai Ba Trung, Hanoi', '<p><strong>INTRODUCE</strong></p>\n<p><strong>Address</strong>: No. 34 Dai Co Viet Street, Hai Ba Trung, Hanoi</p>\n<p><strong>Working time</strong>: All days of the week (including New Year holidays)</p>\n<ul>\n<li>\n<p>Morning: 07h00 - 12h00</p>\n</li>\n<li>\n<p>Afternoon: 13h30 - 17h00</p>\n</li>\n</ul>\n<p>Hung Viet Oncology Hospital is the first private oncology hospital in Vietnam. The hospital is oriented to develop into a comprehensive healthcare unit comparable to regional and international hospitals.</p>\n<p>A unique feature of the hospital, is the team of doctors who directly visit are leading experts, and deputy heads of major hospitals, specialising in oncology treatment: K Central Hospital, Bach Mai Hospital, and Viet Duc Hospital,... Moreover, the system of equipment to support cancer examination and treatment is focused on investment by the hospital, bringing convenience and optimal efficiency to the oncology treatment process.</p>\n<p>With a team of good doctors a system of invested equipment and clear doctor information, patients can easily book an appointment with the desired doctor with the dedicated support of the staff. Hung Viet Hospital has become a reliable cancer examination and treatment address chosen by many people.</p>\n', '**INTRODUCE**\n\n**Address**: No. 34 Dai Co Viet Street, Hai Ba Trung, Hanoi\n\n**Working time**: All days of the week (including New Year holidays)\n\n* Morning: 07h00 - 12h00\n\n* Afternoon: 13h30 - 17h00\n\nHung Viet Oncology Hospital is the first private oncology hospital in Vietnam. The hospital is oriented to develop into a comprehensive healthcare unit comparable to regional and international hospitals.\n\nA unique feature of the hospital, is the team of doctors who directly visit are leading experts, and deputy heads of major hospitals, specialising in oncology treatment: K Central Hospital, Bach Mai Hospital, and Viet Duc Hospital,... Moreover, the system of equipment to support cancer examination and treatment is focused on investment by the hospital, bringing convenience and optimal efficiency to the oncology treatment process.\n\nWith a team of good doctors a system of invested equipment and clear doctor information, patients can easily book an appointment with the desired doctor with the dedicated support of the staff. Hung Viet Hospital has become a reliable cancer examination and treatment address chosen by many people.', 'data:image/png;base64,', '2023-03-09 13:49:18', '2023-03-10 14:11:54');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(4, 'Vietlife Clinic', '14 Tran Binh Trong, Hoan Kiem, Hanoi', '<p><strong>INTRODUCE</strong></p>\n<p>Vietlife MRI Tran Binh Trong Clinic is a private polyclinic in the chain of Vietlife clinics across the country. With a team of professionals, technicians, nurses, and care consultants operating in the medical service industry, healthcare, uses modern medicine, and traditional medicine combined with technology to serve people.</p>\n<p>The team of doctors at Vietlife Clinic are all good doctors with many years of experience, who have been working at major hospitals across the country such as Bach Mai Hospital, National Children\ Hospital, Central Obstetrics Hospital, etc. Central Hospital, Hanoi Medical University Hospital,...</p>\n<p>The clinic is equipped with modern equipment for examination according to strong specialities, meeting the needs of examination and treatment from basic to specialised.</p>\n<p><strong>Address</strong>: No. 14 Tran Binh Trong, Hoan Kiem, Hanoi</p>\n<p><strong>Working time</strong>: All days of the week</p>\n<ul>\n<li>Morning: From 7:30 a.m. to 12:00 p.m</li>\n<li>Afternoon: From 13h30 to 16h30</li>\n<li>Sunday The clinic only works in the morning from 8:00 am - 12:00 pm</li>\n</ul>\n', '**INTRODUCE**\n\nVietlife MRI Tran Binh Trong Clinic is a private polyclinic in the chain of Vietlife clinics across the country. With a team of professionals, technicians, nurses, and care consultants operating in the medical service industry, healthcare, uses modern medicine, and traditional medicine combined with technology to serve people.\n\nThe team of doctors at Vietlife Clinic are all good doctors with many years of experience, who have been working at major hospitals across the country such as Bach Mai Hospital, National Children\s Hospital, Central Obstetrics Hospital, etc. Central Hospital, Hanoi Medical University Hospital,...\n\nThe clinic is equipped with modern equipment for examination according to strong specialities, meeting the needs of examination and treatment from basic to specialised.\n\n**Address**: No. 14 Tran Binh Trong, Hoan Kiem, Hanoi\n\n**Working time**: All days of the week\n\n* Morning: From 7:30 a.m. to 12:00 p.m\n* Afternoon: From 13h30 to 16h30\n* Sunday The clinic only works in the morning from 8:00 am - 12:00 pm', 'data:image/png;base64,', '2023-03-09 13:52:45', '2023-03-10 14:12:06');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(5, 'Saigon Healthcare', '45 Thanh Thai, Ho Chi Minh City', '<p><strong>GENERAL INTRODUCTION</strong></p>\n<p>Saigon Healthcare General Clinic gathers a team of excellent doctors who have been working for many years at major hospitals such as People\ Hospital 115, Tu Du Hospital, Thong Nhat Hospital, and Hung Vuong Hospital, ...</p>\n<p>With most diseases, patients can be examined at the Clinic. Some specialities are developed by the clinic, becoming specialised strengths such as cardiology, endocrinology, gastroenterology, and orthopaedic trauma.</p>\n<p><strong>A team of good doctors, with many years of experience in examination and treatment in the fields of cardiology, endocrinology, gastroenterology, obstetrics and gynaecology.</strong></p>\n<ul>\n<li>Professor, Dr Nguyen Duc Cong - Former Director of Thong Nhat Hospital</li>\n<li>Specialist Doctor I Phan Vuong Huy Dong - 30 years of experience working at People\ Hospital 115</li>\n<li>Specialist II Doctor Tran Thien Vinh Quan - 30 years of experience in the field of Obstetrics and Gynecology, Deputy Director of Hung Vuong Hospital</li>\n<li>Specialist II Huynh Thanh Huong, more than 30 years of experience in the field of Obstetrics and Gynecology, doctor of Tu Du Hospital (1987 - 2018)</li>\n</ul>\n<p>In addition, Saigon Healthcare Clinic has spacious and high-class infrastructure, facilities, machinery and equipment systems that are also modern and synchronously invested by the clinic to serve the examination. effective diagnosis and treatment.</p>\n<p><strong>Address</strong>: 45 Thanh Thai, Ward 14, District 10, Ho Chi Minh City</p>\n', '\n**GENERAL INTRODUCTION**\n\nSaigon Healthcare General Clinic gathers a team of excellent doctors who have been working for many years at major hospitals such as People\ Hospital 115, Tu Du Hospital, Thong Nhat Hospital, and Hung Vuong Hospital, ...\n\nWith most diseases, patients can be examined at the Clinic. Some specialities are developed by the clinic, becoming specialised strengths such as cardiology, endocrinology, gastroenterology, and orthopaedic trauma.\n\n**A team of good doctors, with many years of experience in examination and treatment in the fields of cardiology, endocrinology, gastroenterology, obstetrics and gynaecology.**\n\n* Professor, Dr Nguyen Duc Cong - Former Director of Thong Nhat Hospital\n* Specialist Doctor I Phan Vuong Huy Dong - 30 years of experience working at People\ Hospital 115\n* Specialist II Doctor Tran Thien Vinh Quan - 30 years of experience in the field of Obstetrics and Gynecology, Deputy Director of Hung Vuong Hospital\n* Specialist II Huynh Thanh Huong, more than 30 years of experience in the field of Obstetrics and Gynecology, doctor of Tu Du Hospital (1987 - 2018)\n\nIn addition, Saigon Healthcare Clinic has spacious and high-class infrastructure, facilities, machinery and equipment systems that are also modern and synchronously invested by the clinic to serve the examination. effective diagnosis and treatment.\n\n**Address**: 45 Thanh Thai, Ward 14, District 10, Ho Chi Minh City', 'data:image/png;base64,', '2023-03-09 13:58:17', '2023-03-10 14:12:19');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(6, 'STO Hospital', '72 Thanh Thai, Ho Chi Minh City', '<p><strong>INTRODUCE</strong></p>\n<p>STO Phuong Dong Hospital is a prestigious surgical and orthopaedic hospital in Ho Chi Minh City. A hospital is a place that provides high-quality medical services and meets international standards. STO Phuong Dong Hospital is home to many good and experienced doctors. The hospital\ team of doctors constantly hone their medical knowledge, update new methods and successfully apply them to treat diseases.</p>\n<p>STO Phuong Dong Hospital was established in 2007 by Dr Le Duc To, with a campus with a total area of ​​1800m2, located right in the centre of District 10, on Thanh Thai Street.</p>\n<p><strong>Address</strong>: 79 Thanh Thai, Ward 14, District 10, HCMC</p>\n<p><strong>Working time</strong>: Monday to Saturday</p>\n<ul>\n<li>Morning: 7:30am - 11:30am</li>\n<li>Afternoon: 13h30 - 16h30</li>\n</ul>\n<p><strong>Coverage applies</strong></p>\n<ul>\n<li>State health insurance at the right inpatient line</li>\n<li>State health insurance on the right outpatient line</li>\n</ul>\n<p><strong>Method of payment for medical expenses</strong></p>\n<ul>\n<li>The hospital has payment in the form of cash, swipe card, VN-Pay and transfer</li>\n<li>The hospital supports a red invoice</li>\n</ul>\n', '**INTRODUCE**\n\nSTO Phuong Dong Hospital is a prestigious surgical and orthopaedic hospital in Ho Chi Minh City. A hospital is a place that provides high-quality medical services and meets international standards. STO Phuong Dong Hospital is home to many good and experienced doctors. The hospital\ team of doctors constantly hone their medical knowledge, update new methods and successfully apply them to treat diseases.\n\nSTO Phuong Dong Hospital was established in 2007 by Dr Le Duc To, with a campus with a total area of ​​1800m2, located right in the centre of District 10, on Thanh Thai Street.\n\n**Address**: 79 Thanh Thai, Ward 14, District 10, HCMC\n\n**Working time**: Monday to Saturday\n\n* Morning: 7:30am - 11:30am\n* Afternoon: 13h30 - 16h30\n\n**Coverage applies**\n\n* State health insurance at the right inpatient line\n* State health insurance on the right outpatient line\n\n**Method of payment for medical expenses**\n\n* The hospital has payment in the form of cash, swipe card, VN-Pay and transfer\n* The hospital supports a red invoice', 'data:image/jpeg;base64,', '2023-03-09 14:03:15', '2023-03-10 14:12:32');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(7, 'National Geriatric Hospital', '1A Phuong Mai, Dong Da, Hanoi', '<p><strong>INTRODUCE</strong></p>\n<p>The Central Geriatric Hospital is a hospital specialising in geriatrics, the highest level in the system of examination, treatment and health care for the elderly in Vietnam.</p>\n<p>Because the treatment of the elderly requires careful consideration by a doctor, the elderly often experience many diseases at once. During treatment, doctors are also very careful with the regimen so that optimal treatment can be done without much impact on other diseases.</p>\n<p>Here gathers a team of highly qualified, experienced, enthusiastic and enthusiastic doctors in examining, treating and taking care of patients. The hospital accepts patients aged 16 years or older, in which patients over 50 are entitled to health insurance according to regulations.</p>\n<p>The medical equipment is fully equipped to support examination and treatment. Moreover, the hospital is not too crowded, so it is very convenient and comfortable for patients to visit and treat outpatients as well as inpatients.</p>\n<p><strong>Address:</strong> No. 1A Phuong Mai, Dong Da, Hanoi</p>\n<p><strong>Working time:</strong> Monday to Saturday morning</p>\n<ul>\n<li>Morning: 7 am - 12 pm</li>\n<li>Afternoon: 1 pm - 4.30 pm</li>\n</ul>\n', '\n**INTRODUCE**\n\nThe Central Geriatric Hospital is a hospital specialising in geriatrics, the highest level in the system of examination, treatment and health care for the elderly in Vietnam.\n\nBecause the treatment of the elderly requires careful consideration by a doctor, the elderly often experience many diseases at once. During treatment, doctors are also very careful with the regimen so that optimal treatment can be done without much impact on other diseases.\n\nHere gathers a team of highly qualified, experienced, enthusiastic and enthusiastic doctors in examining, treating and taking care of patients. The hospital accepts patients aged 16 years or older, in which patients over 50 are entitled to health insurance according to regulations.\n\nThe medical equipment is fully equipped to support examination and treatment. Moreover, the hospital is not too crowded, so it is very convenient and comfortable for patients to visit and treat outpatients as well as inpatients.\n\n**Address:** No. 1A Phuong Mai, Dong Da, Hanoi\n\n**Working time:** Monday to Saturday morning\n\n* Morning: 7 am - 12 pm\n* Afternoon: 1 pm - 4.30 pm', 'data:image/jpeg;base64,', '2023-03-09 14:09:00', '2023-03-10 14:12:54');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(8, 'Golden International Clinic', '37 Hoang Hoa Tham, Tan Binh, Ho Chi Minh City', '<p><strong>GENERAL INTRODUCTION</strong></p>\n<p>Golden Healthcare is a polyclinic that provides comprehensive health care and dedicated, safe medical treatment to patients and their families.</p>\n<p>The doctors at the clinic all have at least 15 years of experience and have been working at major hospitals such as Cho Ray Hospital, Nguyen Tri Phuong Hospital, Thong Nhat Hospital, and Ho Chi Minh City Ear Nose Throat Hospital. Ho Chi Minh City, Children\ Hospital...</p>\n<p>In addition, the clinic is equipped with modern machinery and equipment to meet the needs of medical examinations such as Gastroenterology, Otolaryngology, Obstetrics and Gynecology, Pediatrics, Eye, Internal Medicine, and General examination ...</p>\n<p><strong>Address:</strong> No. 37 Hoang Hoa Tham, Ward 13, Tan Binh, Ho Chi Minh City</p>\n<p><strong>Working time:</strong></p>\n<ul>\n<li>Monday to Saturday</li>\n<li>Morning: 7:30am - 11:30am</li>\n<li>Afternoon: 1pm - 5pm</li>\n</ul>\n<p><strong>Coverage applies</strong></p>\n<ul>\n<li>State Health Insurance</li>\n<li>Private insurance: direct guarantee insurance and direct non-guaranteed insurance.</li>\n</ul>\n<p><strong>Payments</strong></p>\n<ul>\n<li>The clinic accepts payment in the form of cash, bank transfer and card swipe.</li>\n<li>The clinic has a red invoice.</li>\n</ul>\n', '\n**GENERAL INTRODUCTION**\n\nGolden Healthcare is a polyclinic that provides comprehensive health care and dedicated, safe medical treatment to patients and their families.\n\nThe doctors at the clinic all have at least 15 years of experience and have been working at major hospitals such as Cho Ray Hospital, Nguyen Tri Phuong Hospital, Thong Nhat Hospital, and Ho Chi Minh City Ear Nose Throat Hospital. Ho Chi Minh City, Children\ Hospital...\n\nIn addition, the clinic is equipped with modern machinery and equipment to meet the needs of medical examinations such as Gastroenterology, Otolaryngology, Obstetrics and Gynecology, Pediatrics, Eye, Internal Medicine, and General examination ...\n\n**Address:** No. 37 Hoang Hoa Tham, Ward 13, Tan Binh, Ho Chi Minh City\n\n**Working time:**\n\n* Monday to Saturday\n* Morning: 7:30am - 11:30am\n* Afternoon: 1pm - 5pm\n\n**Coverage applies**\n\n* State Health Insurance\n* Private insurance: direct guarantee insurance and direct non-guaranteed insurance.\n\n**Payments**\n\n* The clinic accepts payment in the form of cash, bank transfer and card swipe.\n* The clinic has a red invoice.', 'data:image/png;base64,', '2023-03-09 14:14:24', '2023-03-10 14:13:09');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(9, 'Singapore Indochina Healthcare Group', '16 Ton Dat Tien, Ho Chi Minh City', '<p><strong>INTRODUCE</strong></p>\n<p><strong>Address:</strong> No. 16 Ton Dat Tien (Ken Dao Area), Tan Phong Ward, District 7, Ho Chi Minh City</p>\n<p><strong>Working time:</strong></p>\n<ul>\n<li>Monday to Sunday</li>\n<li>7:30 a.m. to 5:00 p.m</li>\n</ul>\n<p>Singapore Indochina Healthcare Group (SIHG) was established to bring patients to experience high-quality screening and treatment services according to Singapore standards right in Vietnam.</p>\n<p>SIHG is built according to the model of a specialised clinic, including screening, initial diagnosis in Vietnam and consultation with good doctors in Singapore for the best treatment regimen for each patient.</p>\n<p>The clinic has cooperation between good, experienced and reputable specialists from Singapore and Vietnam, which will bring you professional, standard, quality, and guaranteed healthcare services. confidentiality and compassion according to international standards.</p>\n', '\n**INTRODUCE**\n\n**Address:** No. 16 Ton Dat Tien (Ken Dao Area), Tan Phong Ward, District 7, Ho Chi Minh City\n\n**Working time:**\n\n* Monday to Sunday\n* 7:30 a.m. to 5:00 p.m\n\nSingapore Indochina Healthcare Group (SIHG) was established to bring patients to experience high-quality screening and treatment services according to Singapore standards right in Vietnam.\n\nSIHG is built according to the model of a specialised clinic, including screening, initial diagnosis in Vietnam and consultation with good doctors in Singapore for the best treatment regimen for each patient.\n\nThe clinic has cooperation between good, experienced and reputable specialists from Singapore and Vietnam, which will bring you professional, standard, quality, and guaranteed healthcare services. confidentiality and compassion according to international standards.', 'data:image/png;base64,', '2023-03-09 14:20:09', '2023-03-10 14:13:19');
