INSERT INTO "Markdowns" ("id", "contentHTML", "contentMarkdown", "description", "doctorId", "specialtyId", "clinicId", "createdAt", "updatedAt") VALUES
(1, '<h3><strong>Associate Professor Ngoc Anh Vu</strong></h3>\n<ul>\n<li>\n<p>Associate Professor of Otolaryngology</p>\n</li>\n<li>\n<p>Former Head of Children\ Otolaryngology Department, National Hospital of Otolaryngology</p>\n</li>\n<li>\n<p>Over 25 years working at the Central Ear Nose Throat Hospital</p>\n</li>\n<li>\n<p>Resident Doctor specializing in Ear, Nose and Throat</p>\n</li>\n<li>\n<p>Doctor who trained in the French Republic in Ear, Nose and Throat</p>\n</li>\n</ul>\n<h3><strong>Examination &amp; treatment</strong></h3>\n<ul>\n<li>\n<p>Specialises in the examination and treatment of adult ear, nose and throat diseases</p>\n</li>\n<li>\n<p>Specialises in examination and treatment of children\ ear, nose and throat diseases</p>\n</li>\n<li>\n<p>Endoscopy otolaryngology</p>\n</li>\n<li>\n<p>Performing Ear Nose Throat technical procedures</p>\n</li>\n</ul>\n<h3><strong>Ear diseases</strong></h3>\n<ul>\n<li>\n<p>Tinnitus, hearing loss, sudden deafness</p>\n</li>\n<li>\n<p>Purulent ear discharge, acute and chronic otitis media</p>\n</li>\n<li>\n<p>Endoscopic tympanic membrane patching</p>\n</li>\n<li>\n<p>Early detection and good treatment of otitis media, tympanic membrane closed, no pus draining out</p>\n</li>\n</ul>\n<h3><strong>Nasal and sinus diseases</strong></h3>\n<ul>\n<li>\n<p>Allergic Rhinitis, Vasomotor Rhinitis</p>\n</li>\n<li>\n<p>Chronic stuffy nose, stuffy nose</p>\n</li>\n<li>\n<p>Chronic polysinusitis is difficult to heal for a long time, polyps in the nose and sinuses</p>\n</li>\n<li>\n<p>Sinus fungus</p>\n</li>\n<li>\n<p>Chronic sinus headache…</p>\n</li>\n</ul>\n<h3><strong>Diseases of the pharynx</strong></h3>\n<ul>\n<li>\n<p>In children with VA, chronic nasopharyngitis</p>\n</li>\n<li>\n<p>Complications of VA (such as otitis media, acute otitis media, laryngitis, etc.)</p>\n</li>\n<li>\n<p>Acute and chronic tonsillitis</p>\n</li>\n<li>\n<p>Grated V.A</p>\n</li>\n<li>\n<p>Tonsillectomy</p>\n</li>\n</ul>\n', '\n\n###  **Associate Professor Ngoc Anh Vu**\n\n\n* Associate Professor of Otolaryngology\n\n* Former Head of Children\ Otolaryngology Department, National Hospital of Otolaryngology\n\n* Over 25 years working at the Central Ear Nose Throat Hospital\n\n* Resident Doctor specializing in Ear, Nose and Throat\n\n* Doctor who trained in the French Republic in Ear, Nose and Throat\n\n\n### **Examination & treatment**\n\n\n* Specialises in the examination and treatment of adult ear, nose and throat diseases\n\n* Specialises in examination and treatment of children\ ear, nose and throat diseases\n\n* Endoscopy otolaryngology\n\n* Performing Ear Nose Throat technical procedures\n\n\n### **Ear diseases**\n\n\n* Tinnitus, hearing loss, sudden deafness\n\n* Purulent ear discharge, acute and chronic otitis media\n\n* Endoscopic tympanic membrane patching\n\n* Early detection and good treatment of otitis media, tympanic membrane closed, no pus draining out\n\n\n### **Nasal and sinus diseases**\n\n\n* Allergic Rhinitis, Vasomotor Rhinitis\n\n* Chronic stuffy nose, stuffy nose\n\n* Chronic polysinusitis is difficult to heal for a long time, polyps in the nose and sinuses\n\n* Sinus fungus\n\n* Chronic sinus headache…\n\n\n### **Diseases of the pharynx**\n\n\n* In children with VA, chronic nasopharyngitis\n\n* Complications of VA (such as otitis media, acute otitis media, laryngitis, etc.)\n\n* Acute and chronic tonsillitis\n\n* Grated V.A\n\n* Tonsillectomy', 'Former Head of Children\ Otolaryngology Department, National Hospital of Otolaryngology\nOver 25 years of working at the Central Ear, Nose and Throat Hospital\nSpecialises in the examination and treatment of diseases of the ear, nose and throat in adults and children\n ', 10, NULL, NULL, '2023-01-27 18:52:58', '2023-01-30 08:17:26'),
